description:
This interesting miniseries explores the origins of Warren Worthington III, better known as Angel and one of the five original X-Men. It features terrific writing by Roberto Aguirre-Sacasa of Afterlife With Archie fame, and art by Adam Polina. Definitely a can't-miss for fans of the character or the X-Men in general.

This is all five issues of the miniseries in new digital copies, thanks to AnPymGold-Empire. Please seed, and enjoy.

